Приложение MedSwiss хранит всю информацию о Вашем здоровье в одном месте. Данное приложение позволит Вам:
- Получить информацию о клиниках MedSwiss и о врачах, ведущих прием;
- Ознакомиться с расписанием приема врачей;
- Записаться на прием;
- Получить результаты анализов, диагностических процедур, заключения врачей.


Чтобы получить полный доступ к приложению, включая доступ к мобильной медицинской карте, обратитесь к сотрудникам клиники на ресепшн с документом, удостоверяющим личность.

